import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';


const App = () => {
    
    return (
        <>
            <Carousel showDots customDot={<CustomDot />}>
  {carouselItems}
</Carousel>;
        </>
    )
}

export default App
